export default function Synonyms(props) {
  console.log("Received synonyms:", props.synonyms); // Debugging

  if (props.synonyms && props.synonyms.length > 0) {
    console.log("Rendering Synonyms Component"); // Debugging

    return (
      <ul className="Synonyms">
        {props.synonyms.map((synonym, index) => (
          <em>
            {" "}
            <li key={index}>{synonym}</li>
          </em>
        ))}
      </ul>
    );
  } else {
    console.log("No synonyms available, returning null"); // Debugging
    return null;
  }
}
